@Chael Sonnen you are incorrect about something:

You said: 'it's that he has to worry about Tony's kickboksing he never had to worry about anybody's kickboksing, It's not that he has to worry about Tony's jab he never had to worry about anybody's jab'. Dear Chael Tony ain't a kickbokser. He has a muaythai stand up basic. In close reach he will use his ellbows and knees. Those are easier to slight through guards.If he can't Take Tony down directly, Khabib will have to fight a bitt in a longer range then normally against a Taller guy. Because he can't just walk Tony down like he did with other guys. Too much cut threat. And while aiming for ground and pound don't forget Khabib almost got submitted in his last fight while the opponent was on his back, I'm sure Tony has noticed.

So those factors make it another fight. I still got khabib winning tho. Because of the way Kevin Lee Almost destroyed Tony before falling in the submission. Just too much fire power. But I can see scenarios in which Tony will be winning by submission or by Cuts as well, I still got Khabib winning. Tony takes too much risks.
